a&gt;        &lt;/div&gt;\n        &lt;/div&gt;\n&lt;/div&gt;\n&lt;p&gt;&lt;a rel=&quot;nofollow&quot; target=&quot;_blank&quot; href=&quot;http://www.ionline.pt/dinheiro/governo-autoriza-parpublica-vender-4-ainda-detem-na-edp&quot;&gt;ler mais&lt;/a&gt;&lt;/p&gt;</description>\n         <guid isPermaLink=\"false\">228717 at http://www.ionline.pt</guid>\n         <pubDate>Wed, 31 Oct 2012 22:04:41 +0000</pubDate>\n      </item>\n      <item>\n         <title>Carlos Costa: prioridade deve ser ajustamento orçamental rápido baseado na despesa</title>\n         <link>http://www.ionline.pt/dinheiro/carlos-costa-prioridade-deve-ser-ajustamento-orcamental-rapido-baseado-na-despesa</link>\n         <description>&lt;div class=&quot;field field-type-nodereference field-field-op-author&quot;&gt;\n      &lt;div class=&quot;field-label&quot;&gt;Autor(es):&amp;nbsp;&lt;/div&gt;\n    &lt;div class=&quot;field-items&quot;&gt;\n            &lt;div class=&quot;field-item odd&quot;&gt;\n                    &lt;a rel=&quot;nofollow&quot;&gt;Agência Lusa&lt;/a&gt;        &lt;/div&gt;\n        &lt;/div&gt;\n&lt;/div&gt;\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\n&lt;div class=&quot;field field-type-nodereference field-field-op-related-mmedia&quot;&gt;\n    &lt;div class=&quot;field-items&quot;&gt;\n            &lt;div class=&quot;field-item odd&quot;&gt;\n                      &lt;div class=&quot;field-label-inline-first&quot;&gt;\n              Multimédia Relacionada:&amp;nbsp;&lt;/div&gt;\n                    &lt;a rel=&quot;nofollow&quot;&gt;Carlos Costa, governador do Banco de Portugal&lt;/a&gt;        &lt;/div&gt;\n        &lt;/div&gt;\n&lt;/div&gt;\n&lt;p&gt;&lt;a rel=&quot;nofollow&quot; target=&quot;_blank&quot; href=&quot;http://www.ionline.pt/dinheiro/carlos-costa-prioridade-deve-ser-ajustamento-orcamental-rapido-baseado-na-despesa&quot;&gt;ler mais&lt;/a&gt;&lt;/p&gt;</description>\n         <guid isPermaLink=\"false\">228716 at http://www.ionline.pt</guid>\n         <pubDate>Wed, 31 Oct