pleiria;jsessionid=32532679682db0fb58fd41442197?p_id=13681&amp;content.id=347881</link>\r\n      <description>&lt;p&gt;12 de junho&lt;/p&gt;</description>\r\n      <pubDate>Fri, 22 Jun 2012 18:52:21 GMT</pubDate>\r\n      <guid>http://www.ipleiria.pt:80/portal/ipleiria;jsessionid=32532679682db0fb58fd41442197?p_id=13681&amp;content.id=347881</guid>\r\n      <dc:creator>ipleiria@ipleiria.pt (IPLeiria)</dc:creator>\r\n      <dc:date>2012-06-22T18:52:21Z</dc:date>\r\n    </item>\r\n    <item>\r\n      <title>Mestrados IPL</title>\r\n      <link>http://www.ipleiria.pt:80/portal/ipleiria;jsessionid=32532679682db0fb58fd41442197?p_id=13681&amp;content.id=346191</link>\r\n      <description>&lt;p&gt;Candidaturas para os mestrados em Educação: até 18 de julho&lt;/p&gt;</description>\r\n      <pubDate>Fri, 08 Jun 2012 09:26:24 GMT</pubDate>\r\n      <guid>http://www.ipleiria.pt:80/portal/ipleiria;jsessionid=32532679682db0fb58fd41442197?p_id=13681&amp;content.id=346191</guid>\r\n      <dc:creator>ipleiria@ipleiria.pt (IPLeiria)</dc:creator>\r\n      <dc:date>2012-06-08T09:26:24Z</dc:date>\r\n    </item>\r\n    <item>\r\n      <title>1.ª Conferência Internacional Pontes Europa-China</title>\r\n      <link>http://www.ipleiria.pt:80/portal/ipleiria;jsessionid=32532679682db0fb58fd41442197?p_id=13681&amp;content.id=345481</link>\r\n      <description>&lt;p&gt;O Instituto Politécnico de Leiria debate amanhã e quarta-feira,\r\ndias 5 e 6 de junho, as oportunidades de uma estratégia global\r\nentre a Europa e a China, na 1.ª Conferência Internacional Pontes\r\nEuropa-China.&lt;/p&gt;</description>\r\n      <pubDate>Mon, 04 Jun 2012 16:33:38 GMT</pubDate>\r\n      <guid>http://www.ipleiria.pt:80/portal/ipleiria;jsessionid=32532679682db0fb58fd41442197?p_id=13681&amp;content.id=345481</guid>\r\n      <dc:creator>ipleiria@ipleiria.pt (IPLeiria)</dc:creator>\r\n      <dc:date>2012-06-04T16:33:38Z</dc:date>\r\n    </item>\r\n    <item>\r\n      <title>IPLeiria promove Caminhada Solidária</title>\r\n      <link>http://www.ipleiria.pt:80/portal/ipleiria;jsessionid=32532679682db0fb58fd41442197?p_id=13681&amp;content.id=345286</link>\r\n      <description>&lt;p&gt;O IPLeiria organiza no próximo domingo, dia 3 de junho, a sua\r\nprimeira Caminhada Solidária, que juntará a comunidade académica e\r\no público em geral num momento de convívio, descontração e contacto\r\ncom a Natureza, e que possibilitará a recolha de bens alimentares\r\nem favor do Banco Alimentar Contra a Fome de Leiria-Fátima.&lt;/p&gt;</description>\r\n      <pubDate>Fri, 01 Jun 2012 10:46:46 GMT</pubDate>\r\n      <guid>http://www.ipleiria.pt:80/portal/ipleiria;jsessionid=32532679682db0fb58fd41442197?p_id=13681&amp;content.id=345286</guid>\r\n      <dc:creator>ipleiria@ipleiria.pt (IPLeiria)</dc:creator>\r\n      <dc:date>2012-06-01T10:46:46Z</dc:date>\r\n    </item>\r\n    <item>\r\n      <title>Cursos de Especialiação Tecnológica</title>\r\n      <link>http://www.ipleiria.pt:80/portal/ipleiria;jsessionid=32532679682db0fb58fd41442197?p_id=13681&amp;content.id=343936</link>\r\n      <description>&lt;p&gt;Manifestação Interesse&lt;/p&gt;</description>\r\n      <pubDate>Fri, 18 May 2012 15:09:04 GMT</pubDate>\r\n      <guid>http://www.ipleiria.pt:80/portal/ipleiria;jsessionid=32532679682db0fb58fd41442197?p_id=13681&amp;content.id=343936</guid>\r\n      <dc:creator>ipleiria@ipleiria.pt (IPLeiria)</dc:creator>\r\n      <dc:date>2012-05-18T15:09:04Z</dc:date>\r\n    </item>\r\n    <item>\r\n      <title>IPLeiria recebe medalha de ouro do município</title>\r\n      <link>http://www.ipleiria.pt:80/portal/ipleiria;jsessionid=32532679682db0fb58fd41442197?p_id=13681&amp;content.id=343865</link>\r\n      <description>&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;O Instituto Politécnico de Leiria recebe, no próximo da 22 de\r\nmaio a Medalha de Ouro do Município de Leiria, pelas 10h15, no\r\nTeatro José Lúcio da Silva, em Leiria.&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;</description>\r\n      <