INSERT INTO `cache_field` VALUES ('field:node:1','a:3:{s:4:\"body\";a:1:{s:3:\"und\";a:1:{i:0;a:5:{s:5:\"value\";s:620:\"Emergency sirens sounded late on Saturday to alert residents, and evacuations of low-lying areas were ordered.\r\n\r\nThe first waves were reported to be up to 2.5ft (76cm) in one area.\r\n\r\nWave heights of three to six feet were predicted in some areas, as \"urgent action\" was advised to protect lives.\r\n\r\nThere were no immediate reports of damage on the Canadian coast following the earthquake.\r\n\r\nTsunami alerts that were issued for coastal areas of Alaska and British Columbia were swiftly downgraded.\r\n\r\nThe quake hit 125 miles (200km) south-west of the Canadian mining town of Prince Rupert at a depth of 11 miles (18km)\";s:7:\"summary\";s:0:\"\";s:6:\"format\";s:13:\"filtered_html\";s:10:\"safe_value\";s:648:\"<p>Emergency sirens sounded late on Saturday to alert residents, and evacuations of low-lying areas were ordered.</p>\n<p>The first waves were reported to be up to 2.5ft (76cm) in one area.</p>\n<p>Wave heights of three to six feet were predicted in some areas, as \"urgent action\" was advised to protect lives.</p>\n<p>There were no immediate reports of damage on the Canadian coast following the earthquake.</p>\n<p>Tsunami alerts that were issued for coastal areas of Alaska and British Columbia were swiftly downgraded.</p>\n<p>The quake hit 125 miles (200km) south-west of the Canadian mining town of Prince Rupert at a depth of 11 miles (18km)</p>\n\";s:12:\"safe_summary\";s:0:\"\";}}}s:10:\"field_tags\";a:1:{s:3:\"und\";a:1:{i:0;a:1:{s:3:\"tid\";s:1:\"1\";}}}s:11:\"field_image\";a:0:{}}',0,1351721592,1),('field:node:10','a:0:{}',0,1351721592,1),('field:node:100','a:1:{s:27:\"field_feed_item_description\";a:1:{s:3:\"und\";a:1:{i:0;a:5:{s:5:\"value\";s:32:\"<p>Todas as edições online</p>\";s:7:\"summary\";N;s:6:\"format\";s:13:\"filtered_html\";s:10:\"safe_value\";s:33:\"<p>Todas as edições online</p>\n\";s:12:\"safe_summary\";