INSERT INTO `field_data_field_feed_item_description` VALUES ('node','feed_item',0,11,11,'und',0,'<img src=\"http://wreport.weborama.fr/fcgi-bin/comptage_wreport.fcgi?WRP_ID=294353&amp;WRP_SECTION=HP&amp;WRP_SUBSECTION=HP RSS&amp;WRP_CONTENT=RSS CONTENT&amp;MEDIA=RSS\" width=\"1\" height=\"1\" alt=\"\"/><img src=\"http://feeds.feedburner.com/~r/PublicoCultura/~4/HJhqXS1HXBI\" height=\"1\" width=\"1\"/>',NULL,'filtered_html'),('node','feed_item',0,12,12,'und',0,'O PCP considerou hoje que o Orçamento de 2013 “tudo agrava” e estabelece que “a austeridade não tem fim”, sublinhando a responsabilidade “individual” de cada deputado que votar o documento.\n<p><a rel=\"nofollow\" target=\"_blank\" href=\"http://feedads.g.doubleclick.net/~a/zvVlUUOtudrTCIrtYTxsFwRd1cY/0/da\"><img src=\"http://feedads.g.doubleclick.net/~a/zvVlUUOtudrTCIrtYTxsFwRd1cY/0/di\" border=\"0\" ismap></a><br/>\n<a rel=\"nofollow\" target=\"_blank\" href=\"http://feedads.g.doubleclick.net/~a/zvVlUUOtudrTCIrtYTxsFwRd1cY/1/da\"><img src=\"http://feedads.g.doubleclick.net/~a/zvVlUUOtudrTCIrtYTxsFwRd1cY/1/di\" border=\"0\" ismap></a></p><div class=\"feedflare\">\n<a rel=\"nofollow\" target=\"_blank\" href=\"http://feeds.feedburner.com/~ff/ddPolitica?a=vmuRZsqAgyg:laKR0OGVfvU:yIl2AUoC8zA\"><img src=\"http://feeds.feedburner.com/~ff/ddPolitica?d=yIl2AUoC8zA\" border=\"0\"></a> <a rel=\"nofollow\" target=\"_blank\" href=\"http://feeds.feedburner.com/~ff/ddPolitica?a=vmuRZsqAgyg:laKR0OGVfvU:qj6IDK7rITs\"><img src=\"http://feeds.feedburner.com/~ff/ddPolitica?d=qj6IDK7rITs\" border=\"0\"></a>\n</div>',NULL,'filtered_html'),('node','feed_item',0,13,13,'und',0,'<div class=\"field field-type-nodereference field-field-op-author\">\n      <div class=\"field-label\">Autor(es):&nbsp;</div>\n    <div class=\"field-items\">\n            <div class=\"field-item odd\">\n                    <a rel=\"nofollow\">Agência Lusa</a>        </div>\n        </div>\n</div>\n<p>A venda de alguns produtos financeiros complexos a investidores particulares vai ser limitada pelo supervisor do mercado, revelou hoje o presidente da CMVM, Carlos Tavares.</p>\n<div class=\"field field-type-nodereference field-field-op-related-mmedia\">\n    <div class=\"field-items\">\n            <div class=\"field-item odd\">\n                      <div class=\"field-label-inline-first\">\n              Multimédia Relacionada:&nbsp;</div>\n                    <a rel=\"nofollow\">Carlos Tavares</a>        </div>\n        </div>\n</div>\n<p><a rel=\"nofollow\" target=\"_blank\" href=\"http://www.ionline.pt/dinheiro/poupanca-cmvm-quer-limitar-venda-produtos-complexos-investidores-particulares\">ler mais</a></p>',NULL,'filtered_html'),('node','feed_item',0,14,14,'und',0,'O deputado do CDS-PP Telmo Correia justificou hoje o voto favorável ao Orçamento do Estado para 2013 com a necessidade de evitar uma \"crise política de contornos imprevisíveis\", frisando estar consciente dos sacrifícios pedidos aos portugueses.\n<p><a rel=\"nofollow\" target=\"_blank\" href=\"http://feedads.g.doubleclick.net/~a/eKIQ4pd6VOwIc4vnhsqPtJsOhR4/0/da\"><img src=\"http://feedads.g.doubleclick.net/~a/eKIQ4pd6VOwIc4vnhsqPtJsOhR4/0/di\" border=\"0\" ismap></a><br/>\n<a rel=\"nofollow\" target=\"_blank\" href=\"http://feedads.g.doubleclick.net/~a/eKIQ4pd6VOwIc4vnhsqPtJsOhR4/1/da\"><img src=\"http://feedads.g.doubleclick.net/~a/eKIQ4pd6VOwIc4vnhsqPtJsOhR4/1/di\" border=\"0\" ismap></a></p><div class=\"feedflare\">\n<a rel=\"nofollow\" target=\"_blank\" href=\"http://feeds.feedburner.com/~ff/ddPolitica?a=zEVmdlMwkSs:oIZeHBmwpWI:yIl2AUoC8zA\"><img src=\"http://feeds.feedburner.com/~ff/ddPolitica?d=yIl2AUoC8zA\" border=\"0\"></a> <a rel=\"nofollow\" target=\"_blank\" href=\"http://feeds.feedburner.com/~ff/ddPolitica?a=zEVmdlMwkSs:oIZeHBmwpWI:qj6IDK7rITs\"><img src=\"http://feeds.feedburner.com/~ff/ddPolitica?d=qj6IDK7rITs\" border=\"0\"></a>\n</div>',NULL,'filtered_html'),('node','feed_item',0,15,15,'und',0,'<div class=\"field field-type-nodereference field-field-op-author\">\n      <div class=\"field-label\">Autor(es):&nbsp;</div>\n    <div class=\"field-items\">\n            <div class=\"field-item odd\">\n                    <a rel=\"nofollow\">Agência Lusa</a>        </div>\n        </div>\n</div>\n<div class=\"field field-type-nodereference field-field-op-related-mmedia\">\n    <div class=\"field-items\">\n            <div class=\"field-item odd\">\n                      <div class=\"field-label-inline-first\">\n              Multimédia Relacionada:&nbsp;</div>\n                    <a rel=\"nofollow\">Sonae</a>        </div>\n        </div>\n</div>\n<p><a rel=\"nofollow\" target=\"_blank\" href=\"http://www.ionline.pt/dinheiro/sonaecom-reduz-significativamente-investimento-2013-apos-aposta-no-4g-diz-miguel-almeida\">ler mais</a></p>',NULL,'filtered_html'),('node','feed_item',0,16,16,'und',0,'<div class=\"field field-type-nodereference field-field-op-author\">\n      <div class=\"field-label\">Autor(es):&nbsp;</div>\n    <div class=\"field-items\">\n            <div class=\"field-item odd\">\n                    <a rel=\"nofollow\">Agência Lusa</a>        </div>\n        </div>\n</div>\n<div class=\"field field-type-nodereference field-field-op-related-mmedia\">\n    <div class=\"field-items\">\n            <div class=\"field-item odd\">\n                      <div class=\"field-label-inline-first\">\n              Multimédia Relacionada:&nbsp;</div>\n                    <a rel=\"nofollow\">Rui Rio</a>        </div>\n        </div>\n</div>\n<p><a rel=\"nofollow\" target=\"_blank\" href=\"http://www.ionline.pt/portugal/rui-rio-considera-troika-devia-ter-percebido-melhor-realidade-portuguesa-aplicar-medidas-ma\">ler mais</a></p>',NULL,'filtered_html'),('node','feed_item',0,17,17,'und',0,'<img src=\"http://www.tvi24.iol.pt/multimedia/oratvi/multimedia/imagem/id/13376251/200\" align=\"left\" hspace=\"5\"/><br />Fonte da PJ afasta, para já, o envolvimento de crianças portuguesas',NULL,'filtered_html'),('node','feed_item',0,18,18,'und',0,'O Intermarché lançou uma nova campanha que assinala o Dia Mundial da Poupança, não apenas no dia 31 de Outubro, mas durante uma semana.',NULL,'filtered_html'),('node','feed_item',0,19,19,'und',0,'<div class=\"field field-type-nodereference field-field-op-author\">\n      <div class=\"field-label\">Autor(es):&nbsp;</div>\n    <div class=\"field-items\">\n            <div class=\"field-item odd\">\n                    <a rel=\"nofollow\">Agência Lusa</a>        </div>\n        </div>\n</div>\n<div class=\"field field-type-nodereference field-field-op-related-mmedia\">\n    <div class=\"field-items\">\n            <div class=\"field-item odd\">\n                      <div class=\"field-label-inline-first\">\n              Multimédia Relacionada:&nbsp;</div>\n                    <a rel=\"nofollow\">Telmo Correia, CDS-PP</a>        </div>\n        </div>\n</div>\n<p><a rel=\"nofollow\" target=\"_blank\" href=\"http://www.ionline.pt/portugal/oe-2013-crise-politica-seria-pior-teria-contornos-imprevisiveis-diz-telmo-correia\">ler mais</a></p>',NULL,'filtered_html'),('node','feed_item',0,20,20,'und',0,'<p><a rel=\"nofollow\" target=\"_blank\" href=\"http://economico.sapo.pt/noticias/wall-street-abre-em-alta-apos-passagem-do-furacao-sandy_155229.html\"><img src=\"http://economico.sapo.pt/public/uploads/articles/foto_pequena/pequena_wall_street11.jpg\" alt=\"Wall Street abre em alta ap&#xf3;s passagem do furac&#xe3;o Sandy\" align=\"left\"/></a></p>Bolsas norte-americanas voltam hoje a negociar em alta, depois de dois dias encerradas por causa do furacão Sandy.<br clear=\"all\"/>',NULL,'filtered_html'),('node','feed_item',0,21,21,'und',0,'O Governo grego agravou esta quarta-feira as previsões para o défice orçamental de 2013, que, estima agora, será de 5,2% no próximo ano, e não 4,2%, como tinha sido anunciado em Setembro. A economia grega vai também recuar mais do que o esperado – 4,5% de contracção do Produto Interno Bruto (PIB) para 2013, em vez de 3,8%.<img src=\"http://wreport.weborama.fr/fcgi-bin/comptage_wreport.fcgi?WRP_ID=294353&amp;WRP_SECTION=HP&amp;WRP_SUBSECTION=HP RSS&amp;WRP_CONTENT=RSS CONTENT&amp;MEDIA=RSS\" width=\"1\" height=\"1\" alt=\"\"/><img src=\"http://feeds.feedburner.com/~r/PublicoRSS/~4/AkuNMEiVfbY\" height=\"1\" width=\"1\"/>',NULL,'filtered_html'),('node','feed_item',0,22,22,'und',0,'<div class=\"field field-type-nodereference field-field-op-author\">\n      <div class=\"field-label\">Autor(es):&nbsp;</div>\n    <div class=\"field-items\">\n            <div class=\"field-item odd\">\n                    <a rel=\"nofollow\">Agência Lusa</a>        </div>\n        </div>\n</div>\n<p>&nbsp;</p>\n<p>	&nbsp;</p>\n<div class=\"field field-type-nodereference field-field-op-related-mmedia\">\n    <div class=\"field-items\">\n            <div class=\"field-item odd\">\n                      <div class=\"field-label-inline-first\">\n              Multimédia Relacionada:&nbsp;</div>\n                    <a rel=\"nofollow\">Furacão Sandy</a>        </div>\n        </div>\n</div>\n<p><a rel=\"nofollow\" target=\"_blank\" href=\"http://www.ionline.pt/mundo/tempestade-sandy-forcou-conselho-seguranca-da-onu-mudar-instalacoes\">ler mais</a></p>',NULL,'filtered_html'),('node','feed_item',0,23,23,'und',0,'<div class=\"field field-type-nodereference field-field-op-author\">\n      <div class=\"field-label\">Autor(es):&nbsp;</div>\n    <div class=\"field-items\">\n            <div class=\"field-item odd\">\n                    <a rel=\"nofollow\">Agência Lusa</a>        </div>\n        </div>\n</div>\n<p>&nbsp;</p>\n<div class=\"field field-type-nodereference field-field-op-related-mmedia\">\n    <div class=\"field-items\">\n            <div class=\"field-item odd\">\n                      <div class=\"field-label-inline-first\">\n              Multimédia Relacionada:&nbsp;</div>\n                    <a rel=\"nofollow\">A EDP foi vendida aos chineses da &quot;Three Gorges&quot; que vai investir seis mil m