12 de maio</p>',NULL,'filtered_html'),('node','feed_item',0,186,186,'und',0,'<p>Com o objetivo de promover a internacionalização, vai ser\ndinamizado um conjunto de iniciativas que envolve as cinco escolas\ndo Instituto.</p>',NULL,'filtered_html'),('node','feed_item',0,187,187,'und',0,'<p>Candidaturas até 30 de abril</p>',NULL,'filtered_html'),('node','feed_item',0,188,188,'und',0,'<p>19 de outubro</p>',NULL,'filtered_html'),('node','feed_item',0,189,189,'und',0,'<p>Sob o tema da “crise”, a conferência “Dialogar e Cooperar em\nTempos de Crise”,&nbsp; a realizar hoje, dia 2 de março, na\nBiblioteca José Saramago, pelas 18 horas, seguida de assinatura de\nprotocolo entre o IPLeiria e a UGT.</p>\n\n<p>&nbsp;</p>',NULL,'filtered_html'),('node','feed_item',0,190,190,'und',0,'<p>Pré-inscrições até 1 de março</p>',NULL,'filtered_html'),('node','feed_item',0,191,191,'und',0,'<p>Resultados Finais Homologados</p>',NULL,'filtered_html'),('node','feed_item',0,192,192,'und',0,'<p>Reunião geral - 8 e 9 de fevereiro</p>',NULL,'filtered_html'),('node','feed_item',0,193,193,'und',0,'<p>Projeto de mobilidade internacional</p>\n\n<p>&nbsp;</p>',NULL,'filtered_html'),('node','feed_item',0,194,194,'und',0,'<p>Candidaturas até 27 de fevereiro</p>',NULL,'filtered_html'),('node','feed_item',0,195,195,'und',0,'<p>Informação à Comunidade Científica</p>',NULL,'filtered_html'),('node','feed_item',0,196,196,'und',0,'<p>Missa do 7.º dia a 28 de janeiro</p>',NULL,'filtered_html'),('node','feed_item',0,197,197,'und',0,'<p>&nbsp;</p>\n\n<p>Está aberta uma nova fase de candidatura a bolsas de estudo para\nestudantes que ingressaram, no presente ano letivo, pela primeira\nvez no Ensino Superior público (1.º ano de licenciaturas) no\nperíodo compreendido entre os dias <strong>16 e 31 de\njaneiro</strong>, inclusive.</p>\n\n<p>&nbsp;</p>',NULL,'filtered_html'),('node','feed_item',0,198,198,'und',0,'<p>Apresentação de filmes</p>\n\n<p>até 31 de março</p>',NULL,'filtered_html'),('node','feed_item',0,199,199,'und',0,'<p>Concurso de Planos de Negócio: até 15 de Junho</p>',NULL,'filtered_html'),('node','feed_item',0,200,200,'und',0,'<p>Todas as edições online</p>',NULL,'filtered_html'),('node','feed_item',0,201,201,'und',0,'<p>Candidaturas de 2 a 31 de Janeiro</p>',NULL,'filtered_html'),('node','feed_item',0,202,202,'und',0,'<p>Dia 2 de janeiro ficará disponível o novo portal dos estudantes\ndo Instituto Politécnico de Leiria. Nesta página poderão ser\nencontradas informações e notícias dirigidas unicamente para os\nestudantes, e consultadas informações pessoais, unidades\ncurriculares, histórico e mapa de avaliações, conta-corrente\nacadémica e horários.</p>',NULL,'filtered_html'),('node','feed_item',0,203,203,'und',0,'<p>Região do Pinhal Litoral</p>',NULL,'filtered_html'),('node','feed_item',0,204,204,'und',0,'<p>Proposta da Comissão Europeia para o período 2014 -2020</p>',NULL,'filtered_html'),('node','feed_item',0,205,205,'und',0,'<p>&nbsp;</p>\n\n<p>A Formação de Executivos tem abertas candidaturas, até 28 de\ndezembro, para as pós-graduações em:</p>\n\n<p>&nbsp;</p>\n\n<p>- 6 Sigma ao Nível de Black Belt</p>\n\n<p>- Auditores de HACCP</p>\n\n<p>- Business Intelligence e Data Mining</p>\n\n<p>- Comunicação Estratégica e Branding</p>\n\n<p>- Gestão Prática de Projetos</p>\n\n<p>- Open Innovation</p>',NULL,'filtered_html'),('node','feed_item',0,206,206,'und',0,'<p>Erasmus para Todos e Horizonte 2020</p>',NULL,'filtered_html'),('node','feed_item',0,207,207,'und',0,'<p>Candidatura até 30 de novembro</p>',NULL,'filtered_html'),('node','feed_item',0,208,208,'und',0,'<p>Discursos e Fotografias</p>\n\n<p>&nbsp;</p>',NULL,'filtered_html'),('node','feed_item',0,209,209,'und',0,'<p>&nbsp;</p>\n\n<p><strong>Mário Soares</strong> foi o convidado do IPL que\nproferiu a Oração de Sapiência: “Que futuro para esta nossa\nEuropa”, na Sessão Solene de Abertura do Ano Letivo 2011/2012, que\ndecorreu dia <strong>17 de novembro</strong>, às <strong>15\nhoras</strong>, no auditório 1, do Edifício B, da <strong>Escola\nSuperior de Tecnologia e Gestão</strong> (<em>campus</em> 2 do IPL,\nem Leiria).</p>\n\n<p>&nbsp;</p>',NULL,'filtered_html'),('node','feed_item',0,210,210,'und',0,'<p>Início das aulas | horários</p>',NULL,'filtered_html'),('node','feed_item',0,211,211,'und',0,'<p>Comunicações e Fotografias</p>',NULL,'filtered_html'),('node','feed_item',0,212,212,'und',0,'<p>Candidaturas de 2 a 30 de novembro</p>',NULL,'filtered_html'),('node','feed_item',0,213,213,'und',0,'<p>Candidaturas de&nbsp;1 a 30 de novembro</p>',NULL,'filtered_html'),('node','feed_item',0,214,214,'und',0,'<p>Resultados finais e matrículas</p>',NULL,'filtered_html'),('node','feed_item',0,215,215,'und',0,'<p>Candidaturas até 7 de novembro</p>',NULL,'filtered_html'),('node','feed_item',0,216,216,'und',0,'<p>Eleição dos representantes dos estudantes</p>',NULL,'filtered_html'),('node','feed_item',0,217,217,'und',0,'<p>3 a 10 de Outubro</p>',NULL,'filtered_html'),('node','feed_item',0,218,218,'und',0,'<p>Matrículas de 18 a&nbsp;20 de outubro</p>',NULL,'filtered_html'),('node','feed_item',0,219,219,'und',0,'<p>De 28 de setembro a 1 de outubro</p>',NULL,'filtered_html'),('node','feed_item',0,220,220,'und',0,'<p>Época excecional de exames</p>',NULL,'filtered_html'),('node','feed_item',0,221,221,'und',0,'<p>Candidaturas de 5 a 20 de Setembro</p>',NULL,'filtered_html'),('node','feed_item',0,222,222,'und',0,'<p>5 a 20 de Setembro</p>',NULL,'filtered_html'),('node','feed_item',0,223,223,'und',0,'<p>Resultados</p>',NULL,'filtered_html'),('node','feed_item',0,224,224,'und',0,'<p>8 a 19 de Agosto</p>',NULL,'filtered_html'),('node','feed_item',0,225,225,'und',0,'<p>Até 31 de Agosto</p>',NULL,'filtered_html'),('node','feed_item',0,226,226,'und',0,'<p>Até 16 de Agosto</p>',NULL,'filtered_html');
