199,199,'und',0,'<p>Concurso de Planos de Negócio: até 15 de Junho</p>',NULL,'filtered_html'),('node','feed_item',0,200,200,'und',0,'<p>Todas as edições online</p>',NULL,'filtered_html'),('node','feed_item',0,201,201,'und',0,'<p>Candidaturas de 2 a 31 de Janeiro</p>',NULL,'filtered_html'),('node','feed_item',0,202,202,'und',0,'<p>Dia 2 de janeiro ficará disponível o novo portal dos estudantes\ndo Instituto Politécnico de Leiria. Nesta página poderão ser\nencontradas informações e notícias dirigidas unicamente para os\nestudantes, e consultadas informações pessoais, unidades\ncurriculares, histórico e mapa de avaliações, conta-corrente\nacadémica e horários.</p>',NULL,'filtered_html'),('node','feed_item',0,203,203,'und',0,'<p>Região do Pinhal Litoral</p>',NULL,'filtered_html'),('node','feed_item',0,204,204,'und',0,'<p>Proposta da Comissão Europeia para o período 2014 -2020</p>',NULL,'filtered_html'),('node','feed_item',0,205,205,'und',0,'<p>&nbsp;</p>\n\n<p>A Formação de Executivos tem abertas candidaturas, até 28 de\ndezembro, para as pós-graduações em:</p>\n\n<p>&nbsp;</p>\n\n<p>- 6 Sigma ao Nível de Black Belt</p>\n\n<p>- Auditores de HACCP</p>\n\n<p>- Business Intelligence e Data Mining</p>\n\n<p>- Comunicação Estratégica e Branding</p>\n\n<p>- Gestão Prática de Projetos</p>\n\n<p>- Open Innovation</p>',NULL,'filtered_html'),('node','feed_item',0,206,206,'und',0,'<p>Erasmus para Todos e Horizonte 2020</p>',NULL,'filtered_html'),('node','feed_item',0,207,207,'und',0,'<p>Candidatura até 30 de novembro</p>',NULL,'filtered_html'),('node','feed_item',0,208,208,'und',0,'<p>Discursos e Fotografias</p>\n\n<p>&nbsp;</p>',NULL,'filtered_html'),('node','feed_item',0,209,209,'und',0,'<p>&nbsp;</p>\n\n<p><strong>Mário Soares</strong> foi o convidado do IPL que\nproferiu a Oração de Sapiência: “Que futuro para esta nossa\nEuropa”, na Sessão Solene de Abertura do Ano Letivo 2011/2012, que\ndecorreu dia <strong>17 de novembro</strong>, às <strong>15\nhoras</strong>, no auditório